import Rank from './components/Rank/Rank';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      input: '',
    }
  }
//input property of the app
  onInputChange = (event) => {
    console.log(event.target.value);
  }

  onButtonSubmit = () => {
    console.log('click');
  }

  render() {
    return (
      <div className="App">
          <Navigation />
          <Logo />
          <Rank />
          <ImageLinkForm 
          onInputChange = {this.onInputChange}
          onButtonSubmit = {this.onButtonSubmit}

          />
        {/* 
        <FaceRecognition />} */}
      </div>
    );
  }
}

export default App;
